import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

const Tags = (props) => {

    const Child = () => {

        let {id} = useParams();

        return (
            id
        );
    }

    return (
        <Router>
        <div className="tags-container">
            <Link className="clover-light" to={props.tagName}>{props.tagName}</Link>
        </div>
        <Switch>
        <Route path="/:id" component={Child} />
        </Switch>
        </Router>
    );
}

export default Tags;
